            "description": "A 95% binomial confidence interval for the true neoadjuvant endocrine resistance rate will be constructed for each treatment arm. Logistic regression modeling with likelihood ratio tests will be used to examine the likelihood that endocrine resistance differs with respect to neoadjuvant treatment or pretreatment patient and disease characteristics.",
