            "description": "A 95% binomial confidence interval for the true rate of the outcome will be constructed by treatment arm. Logistic regression modeling with likelihood ration tests will be used to examine whether the likelihood of a given response outcome differs with respect to neoadjuvant treatment.",
            "timeframe": "Up to 4 weeks",
            "type_code": "SECONDARY"
