    "record_verification_date": "2017-11-02",
    "brief_title": "Fulvestrant and / or Anastrozole in Treating Postmenopausal Patients with Stage II-III Breast Cancer Undergoing Surgery",
    "official_title": "ALTernate Approaches for Clinical Stage II or III Estrogen Receptor Positive Breast Cancer NeoAdjuvant TrEatment (ALTERNATE) in Postmenopausal Women: A Phase III Study",
    "acronym": null,
    "keywords": null,
    "brief_summary": "This randomized phase III trial studies fulvestrant to see how well it works compared to anastrozole or fulvestrant and anastrozole in treating postmenopausal patients with stage II-III breast cancer undergoing surgery. Estrogen can cause the growth of breast cancer cells. Hormone therapy using fulvestrant and anastrozole may fight breast cancer by blocking the use of estrogen by the tumor cells. It is not yet known whether giving fulvestrant alone, anastrozole alone, or fulvestrant and anastrozole together is more effective in treating patients with breast cancer.",
    "detail_description": "PRIMARY OBJECTIVES:\r\nI. To determine whether fulvestrant administered for 24 weeks as neoadjuvant endocrine treatment increases the proportion of endocrine sensitive tumors relative to patients treated with anastrozole.\r\nII. To determine whether fulvestrant in combination with anastrozole, administered for 24 weeks as neoadjuvant endocrine treatment, increases the proportion of endocrine sensitive tumors relative to patients treated with anastrozole.\r\nIII. If both of the fulvestrant containing arms are found to have an endocrine sensitive disease rate at least 10% higher than that of the anastrozole arm, we will assess whether the endocrine sensitive disease rate is greater with the combination of anastrozole and fulvestrant than with fulvestrant alone.\r\nIV. To assess whether the 5-year recurrence free survival (RFS) rate among women treated with anastrozole with a modified preoperative endocrine prognostic index (PEPI) score 0 following 24 weeks of neoaduvant therapy is at most 90%.\r\nV. For the fulvestrant containing regimens, a point and interval estimate of the 5 year RFS will be obtained.\r\n\r\nSECONDARY OBJECTIVES:\r\nI. To examine the differences in surgical outcome, clinical and radiological response rates, and safety profile between the fulvestrant arm and the anastrozole arm.\r\nII. To examine the differences in surgical outcome, clinical and radiological response rates, and safety profile between patients randomized to fulvestrant in combination with anastrozole and those randomized to anastrozole.\r\nIII. To examine the rate of pathologic complete response (pCR) of 12 weeks of neoadjuvant paclitaxel in patients with endocrine resistant disease following 4-weeks or 12-weeks of neoadjuvant endocrine therapy (with either fulvestrant or anastrozole or the combination of fulvestrant and anastrozole).\r\nIV. To examine the rate of pathologic complete response (pCR) among those patients with endocrine resistant disease, following 4 weeks or 12-weeks of neoadjuvant endocrine therapy (with either fulvestrant or anastrozole or the combination of fulvestrant and anastrozole), who choose not to receive neoadjuvant paclitaxel, but another standard neoadjuvant taxane and /or anthracycline containing regimen or cyclophosphamide, methotrexate, fluorouracil (CMF). \r\nV. To summarize the frequency of severe (National Cancer Institute Common Terminology Criteria for Adverse Events [NCI CTCAE] grade > 3) adverse events encountered with administration of paclitaxel in the neoadjuvant setting.\r\nVI. To assess time to breast cancer recurrence for patients with endocrine resistant tumors defined by tumor marker of proliferation Ki-67 (Ki67) > 10% at week 4, Ki67 > 10% at week 12 and modified PEPI score of non-zero on neoadjuvant endocrine therapy, with all three groups combined or separated.\r\n\r\nTERTIARY OBJECTIVES:\r\nI. To assess whether the degree of tumor Ki67 suppression at week 4 and surgery differs between patients randomized to fulvestrant and those randomized to anastrozole.\r\nII. To assess whether the degree of tumor Ki67 suppression at week 4 and surgery differs between patients randomized to fulvestrant in combination with anastrozole and those randomized to anastrozole.\r\nIII. To examine the impact of tumor estrogen receptor (ER) expression level post-neoadjuvant endocrine therapy on RFS in each treatment arm separately.\r\nIV. To examine whether RFS differs with respect to pathologic tumor stage (T1 vs. T2) post-neoadjuvant endocrine therapy in the subgroup of women with a modified PEPI score of 0. \r\nV. To examine whether rate of endocrine resistant tumors or RFS differs with respect to the degree of week 4 Ki67 suppression. \r\nVI. To examine whether the rate of week 4 Ki67 level > 10%, the rate of endocrine resistant tumors or RFS differs with respect to pre-treatment gene expression profile.\r\nVII. To examine whether gene expression profiles at week 4 can further refine the patient population who have modified PEPI score non-0 or shorter RFS.\r\nVIII. To assess the pCR/residual cancer burden (RCB)-1 rate in each of the following cohorts: a. Those who chose to switch to paclitaxel after finding their week 4 Ki67 was > 10%; b. Those who chose to switch to paclitaxel after finding their week 12 Ki67 was > 10%; c. Those patients who chose to switch to a standard neoadjuvant taxane and/or anthracycline containing regimen or CMF (rather than paclitaxel) after finding their week 4 Ki67 was > 10%; d. Those patients who chose to switch to a standard neoadjuvant taxane and/or anthracycline containing regimen or CMF (rather than paclitaxel) after finding their week 12 Ki67 was > 10%.\r\nIX. To evaluate cycle 1, day 2 tumor biopsy following the initiation of paclitaxel to develop early molecular markers of tumor response to paclitaxel.\r\nX. To evaluate tumor tissue, serum, and plasma specimens collected at baseline, on-therapy, and at surgery for biomarker discovery (through methods such as gene expression profiling, patterns of gains or losses of deoxyribonucleic acid [DNA], tumor whole genome and targeted DNA and ribonucleic acid [RNA] sequencing and proteomics) in studies that aim to understand signaling pathways associated with endocrine therapy and taxane therapy sensitivity and resistance.\r\n\r\nOUTLINE: Patients are randomized to 1 of 3 treatment arms.\r\n\r\nARM I: Patients receive anastrozole orally (PO) once daily (QD) on days 1-28. Treatment repeats every 4 weeks for 6 courses in the absence of disease progression or unacceptable toxicity. Patients undergo surgery between days 7-28 of course 6. \r\n\r\nARM II: Patients receive fulvestrant intramuscularly (IM) on days 1 and 15 (course 1) and day 1 (courses 2-6). Treatment repeats every 4 weeks for up to 6 courses in the absence of disease progression or unacceptable toxicity. Patients undergo surgery between days 7-28 of course 6. \r\n\r\nARM III: Patients receive anastrozole as in Arm I and fulvestrant IM as in Arm II and undergo surgery between days 7-28 of course 6. \r\n\r\nMODIFIED PEPI 0 VALIDATION PHASE: Patients with endocrine therapy resistant disease, defined by Ki67 > 10% at the 4-week or the 12-week biopsy receive paclitaxel intravenously (IV) over 1 hour on days 1, 8, 15, and 22. Beginning 3-6 weeks later, patients undergo surgery. Treatment repeats every 4 weeks for 3 courses at the discretion of the treating physician. \r\n\r\nAfter completion of study treatment, patients are followed up for 10 years.",
